import callApi from '../../api/admin/Post'

export default function PostList ({match}) {
    const getApi = async () => {
        try {
            callApi.get()
        }

        catch (err) {
            console.log('Get fail!')
        }

    }
    return (
        <>
            <div match={match}>
                <h1>List Post</h1>
            </div>
        </>
    )
}
